  [],\n\t\"revision_timestamp\": \"2016-07-15T04:23:35.979480\",\n\t\"name\": \"medicare-readmission-rates-showed-meaningful-decline-in-2012-aaad0\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>From 2007 through 2011, the national
  30-day, all-cause, hospital readmission rate averaged 19 percent. During calendar
  year 2012, the readmission rate averaged 18.4 percent. Of the 306 HRRs, rates in
  166 HRRs fell by between 1 and 5 percent, while rates dropped by more than 5 percent
  in 73 HRRs, with the largest reduction in Longview, Texas. Rates increased by more
  than 1 percent in only 30 HRRs, with the largest increase in Bloomington, Illinois.
  Readmission rates at hospitals participating in the P4P program have been, on average,
  consistently lower than the rates at non-participating hospitals within all size
  categories except for the very smallest and largest hospitals, but rates at both
  participant and non-participant hospitals fell in 2012.</p>n\",\n\t\"license_title\":
